import React from 'react';

import './Task.css';

const Task = ({task, handleTaskClick}) => {
    return (
        <div
            className='task_container'
            style={task.completed ? { borderLeft: "6px solid chartreuse"} : {}}
        ></div>
    );
}

export default Task;

<div className="task_container">
    {task.title}
</div>
